How did we make the visualizations, you ask? Why, by exporting the data with more adaptors! Let's take a look at how we adapt the stream to write the data needed for the visualizations in this blog post. The data needed for all three visualizations was written to YAML files using only a single pass through the stream. Here is what we need to accomplish in order to obtain all the data needed for the visualizations: enumerate the stream of floats (the enumeration is needed to compute max_index as described above) write the enumerated stream to YAML (used in Figure 1) generate reservoir samples write reservoirs to YAML for the histogram animations (used in Figure 2) calculate the mean and max_index for each reservoir write the (mean, max_index) pair to YAML (used in Figure 3) Finally, the only thing we do inside the loop is count the total number of reservoir samples that were made. This is helpful for initializing array sizes when making the visualizations. Here is the code: // Enumerate the items in the stream; item type is now // Numbered<f64>{count: index, item: f64 value}
let stream = enumerate(stream);
// Write the enumerated stream to YAML as a side effect, // passing through the enumerated items
let stream = write_yaml_documents(stream, population_file.to_string()) .expect("Create File and initialize yaml iter failed.");
// Convert items to reservoir samples of type Vec<Numbered<f64>> let stream = reservoir_iterable(stream, capacity, None);
// Write the reservoirs to YAML as a side effect
let stream = write_yaml_documents( stream, reservoir_samples_file.to_string() ).expect("Create File and initialize yaml iter failed.");
// Convert items to // Numbered<f64>{count: max_index, item: reservoir mean} // using the named closure reservoir_mean_and_max_index let stream = stream.map(reservoir_mean_and_max_index);
// Write these new items to YAML as side effect
let mut stream = write_yaml_documents( stream, reservoir_means_file.to_string() ).expect("Create File and initialize yaml iter failed.");
// num_res is used in the Python script for visualizations to // initialize array sizes
let mut num_res = 0;
while let Some(_item) = stream.next() { num_res += 1
